description:
The Magic Numbers are an English pop rock band comprising two pairs of brothers and sisters from Greenford. The group was formed in 2002, releasing their critically acclaimed[citation needed] debut album titled The Magic Numbers on 13 June 2005. Their follow-up album, Those the Brokes was released on 6 November 2006, and their most recent album &quot;The Runaway&quot; was released on June 6, 2010 and premiered the bands &quot;new&quot; sound.
